import React from "react";

function ExpenseTable({ expenses }) {
    return (
        <section>
            <div>
                <th>Name</th>
                <th>Cost</th>
                <th>Category</th>
            </div>
            {
                expenses.map(
                    (e, i) => <div key={i}>
                        <div>{e.name}</div>
                        <div>{e.cost}</div>
                        <div>{e.category}</div>
                    </div>
                )
            }
        </section>
    )
}

export default ExpenseTable;
